-- ----------------------------
DROP TABLE IF EXISTS `account`;
CREATE TABLE `account` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `user_addr` varchar(255) NOT NULL COMMENT '用户地址',
  `user_id` bigint(20) NOT NULL COMMENT '用户ID',
  `parent` int(11) NOT NULL COMMENT '上级ID',
  `token1_amount` decimal(20,8) NOT NULL DEFAULT '0.00000000' COMMENT 'OPE价值',
  `token2_amount` decimal(20,8) NOT NULL DEFAULT '0.00000000' COMMENT 'GOD价值',
  `level_amount` decimal(20,8) NOT NULL DEFAULT '0.00000000' COMMENT '等级数量',
  `bdao_amount` decimal(20,8) NOT NULL DEFAULT '0.00000000' COMMENT 'bdao可领取数量',
  `old_pure_amount` decimal(20,8) NOT NULL DEFAULT '0.00000000' COMMENT '老用户未回本价值',
  `fh_quota` decimal(20,8) NOT NULL DEFAULT '0.00000000' COMMENT '分红出局额度',
  `mine_amount` decimal(20,8) NOT NULL DEFAULT '0.00000000' COMMENT '挖矿质押价值',
  `mine_quota` decimal(20,8) NOT NULL DEFAULT '0.00000000' COMMENT '挖矿奖励额度',
  `mine_reward_amount` decimal(20,8) NOT NULL DEFAULT '0.00000000' COMMENT '挖矿奖励数量',
  `inner_cn_pool_available` decimal(20,8) NOT NULL DEFAULT '0.00000000' COMMENT '内部储能池可用',
  `inner_cn_pool_frozen` decimal(20,8) NOT NULL DEFAULT '0.00000000' COMMENT '内部储能池冻结',
  `outer_cn_pool_available` decimal(20,8) NOT NULL DEFAULT '0.00000000' COMMENT '外部储能池可用',
  `outer_cn_pool_frozen` decimal(20,8) NOT NULL DEFAULT '0.00000000' COMMENT '外部储能池冻结',
  `wallet_status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '钱包状态 1:正常 2:异常',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  `update_time` int(11) NOT NULL DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `addr` (`user_addr`) USING BTREE,
  UNIQUE KEY `uid` (`user_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=127 DEFAULT CHARSET=utf8 COMMENT='用户资产表';

